---
eventTimeline:
  description: Aggregated information of dates of visit | diagnostic | inclusion in
    study obtained from individual level info of the cohort members.
  properties:
    end:
      description: Latest date of visit or collection timeline
      examples:
      - 2018-10-01T13:23:45Z
      - 2019-04-23T09:11:13Z
      - 2017-01-17T20:33:40Z
      format: datetime
      type: string
    start:
      description: Earliest date of visit or collection timeline
      examples:
      - 2018-10-01T13:23:45Z
      - 2019-04-23T09:11:13Z
      - 2017-01-17T20:33:40Z
      format: datetime
      type: string
  type: object
